WITH filtered_date AS (SELECT d_date_sk, d_date FROM date_dim WHERE d_month_seq BETWEEN 1214 AND 1225), filtered_customer AS (SELECT c_customer_sk, c_last_name, c_first_name FROM customer WHERE c_birth_year BETWEEN 1955 AND 1961), store_sales_join AS (SELECT DISTINCT fc.c_last_name, fc.c_first_name, fd.d_date FROM store_sales ss INNER JOIN filtered_date fd ON ss.ss_sold_date_sk = fd.d_date_sk INNER JOIN filtered_customer fc ON ss.ss_customer_sk = fc.c_customer_sk WHERE ss.ss_list_price BETWEEN 242 AND 271 AND ss.ss_wholesale_cost BETWEEN 35 AND 45), catalog_sales_join AS (SELECT DISTINCT fc.c_last_name, fc.c_first_name, fd.d_date FROM catalog_sales cs INNER JOIN filtered_date fd ON cs.cs_sold_date_sk = fd.d_date_sk INNER JOIN filtered_customer fc ON cs.cs_bill_customer_sk = fc.c_customer_sk WHERE cs.cs_list_price BETWEEN 242 AND 271 AND cs.cs_wholesale_cost BETWEEN 35 AND 45), web_sales_join AS (SELECT DISTINCT fc.c_last_name, fc.c_first_name, fd.d_date FROM web_sales ws INNER JOIN filtered_date fd ON ws.ws_sold_date_sk = fd.d_date_sk INNER JOIN filtered_customer fc ON ws.ws_bill_customer_sk = fc.c_customer_sk WHERE ws.ws_list_price BETWEEN 242 AND 271 AND ws.ws_wholesale_cost BETWEEN 35 AND 45), set_difference AS (SELECT ss.c_last_name, ss.c_first_name, ss.d_date FROM store_sales_join ss WHERE NOT EXISTS (SELECT 1 FROM (SELECT c_last_name, c_first_name, d_date FROM catalog_sales_join UNION ALL SELECT c_last_name, c_first_name, d_date FROM web_sales_join) ex WHERE ex.c_last_name = ss.c_last_name AND ex.c_first_name = ss.c_first_name AND ex.d_date = ss.d_date)) SELECT COUNT(*) FROM set_difference